package adventofcode

import java.util.*
import kotlin.math.min

private const val data5_1 = ""
private const val data5_2 = ""

fun main(args: Array<String>) {
    println(first5(data5_1))
    println(second5(data5_2))
}

fun first5(data: String): Int {
    val stack = Stack<Char>()
    data.forEach {
        val opposite = if (it.isLowerCase()) it.toUpperCase() else it.toLowerCase()
        when {
            stack.isEmpty() -> stack.push(it)
            stack.peek() == opposite -> stack.pop()
            else -> stack.push(it)
        }
    }

    return stack.size
}

fun second5(data: String): Int {
    val chars = data.toCharArray().distinctBy { it.toLowerCase() }
    var result = data.length

    chars.forEach { ch ->
        val str = data.filterNot { it.equals(ch, true) }
        result = min(result, first5(str))

    }

    return result
}
